package com.fashion.binge.fashiondesign.models;/** * Created by gokarna on 20/06/16. */public class OrderDetailModel {    private String orderId;    private String dateAdded;    private String paymentMethod;    private String shippingMethod;    private String paymentDescription;    private String shippingDescription;    private String statusText;    public String getStatusText() {        return statusText;    }    public void setStatusText(String statusText) {        this.statusText = statusText;    }    public String getPaymentDescription() {        return paymentDescription;    }    public void setPaymentDescription(String paymentDescription) {        this.paymentDescription = paymentDescription;    }    public String getShippingDescription() {        return shippingDescription;    }    public void setShippingDescription(String shippingDescription) {        this.shippingDescription = shippingDescription;    }    public String getDateAdded() {        return dateAdded;    }    public void setDateAdded(String dateAdded) {        this.dateAdded = dateAdded;    }    public String getPaymentMethod() {        return paymentMethod;    }    public void setPaymentMethod(String paymentMethod) {        this.paymentMethod = paymentMethod;    }    public String getShippingMethod() {        return shippingMethod;    }    public void setShippingMethod(String shippingMethod) {        this.shippingMethod = shippingMethod;    }    public String getOrderId() {        return orderId;    }    public void setOrderId(String orderId) {        this.orderId = orderId;    }}